• Give me the postal data of Pazo de Breogan
PREFIX pr: <http://GP-onto.fi.upm.es/Practica2#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?street ?number ?town ?province
WHERE { pr:Pazo_Breogan pr:SituadoEn $place;
pr:Direccion $address.
$place rdfs:label ?town;
pr:Provincia ?province.               
$address pr:Calle ?street;
pr:Numero ?number.
}
